import React, { useState, useEffect } from 'react';
import axios from 'axios';
import styles from './ManageServices.module.css';

const ManageServices = () => {
  const [services, setServices] = useState([]);
  const [newService, setNewService] = useState('');
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');
  const [addingService, setAddingService] = useState(false);
  const [updatingService, setUpdatingService] = useState(null);

  useEffect(() => {
    fetchServices();
  }, []);

  const fetchServices = () => {
    setLoading(true);
    axios.get('http://localhost:8080/api/services/get')
      .then(response => {
        setServices(response.data);
        setError('');
      })
      .catch(error => {
        setError('Failed to load services. Please try again later.');
        console.error('Fetch services error:', error);
      })
      .finally(() => {
        setLoading(false);
      });
  };

  const handleAddService = () => {
    if (!newService.trim()) {
      setError('Service name cannot be empty');
      setSuccess('');
      return;
    }

    const serviceData = {
      serviceName: newService.trim(),
      isAvailable: true,
      status: 'Active'
    };

    setError('');
    setSuccess('');
    setAddingService(true);

    axios.post('http://localhost:8080/api/services/save', serviceData)
      .then(() => {
        setNewService('');
        setSuccess('Service added successfully');
        fetchServices();
      })
      .catch(error => {
        console.error('Add service error:', error);
        setError(
          error.response?.data?.message || 
          error.response?.data?.error || 
          error.message || 
          'Failed to add service'
        );
      })
      .finally(() => {
        setAddingService(false);
      });
  };

  const handleToggleAvailability = (serviceId, currentStatus) => {
    setUpdatingService(serviceId);
    
    const updatedStatus = currentStatus === 'Active' ? 'Inactive' : 'Active';
    
    axios.patch(`http://localhost:8080/api/services/${serviceId}/status`, { status: updatedStatus })
      .then(() => {
        setSuccess(`Service status updated to ${updatedStatus}`);
        fetchServices();
      })
      .catch(error => {
        console.error('Update service error:', error);
        setError('Failed to update service status');
      })
      .finally(() => {
        setUpdatingService(null);
      });
  };

  if (loading) return <div className={styles.loading}>Loading services...</div>;

  return (
    <div className={styles.container}>
      <h2>Manage Services</h2>
      
      {error && <div className={styles.error}>{error}</div>}
      {success && <div className={styles.success}>{success}</div>}
      
      <div className={styles.addForm}>
        <input
          type="text"
          value={newService}
          onChange={(e) => setNewService(e.target.value)}
          placeholder="Enter service name"
          className={styles.input}
        />
        <button 
          onClick={handleAddService}
          disabled={addingService}
          className={styles.addButton}
        >
          {addingService ? 'Adding...' : 'Add Service'}
        </button>
      </div>
      
      <div className={styles.servicesList}>
        {services.length === 0 ? (
          <div className={styles.noServices}>No services found</div>
        ) : (
          <table className={styles.servicesTable}>
            <thead>
              <tr>
                <th>Service Name</th>
                <th>Status</th>
                <th>Actions</th>
              </tr>
            </thead>
            <tbody>
              {services.map(service => (
                <tr key={service.serviceId}>
                  <td>{service.serviceName}</td>
                  <td>{service.status}</td>
                  <td>
                    <button
                      onClick={() => handleToggleAvailability(service.serviceId, service.status)}
                      disabled={updatingService === service.serviceId}
                      className={`${styles.toggleBtn} ${service.status === 'Active' ? styles.active : styles.inactive}`}
                    >
                      {updatingService === service.serviceId ? 'Updating...' : 
                       service.status === 'Active' ? 'Deactivate' : 'Activate'}
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>
    </div>
  );
};

export default ManageServices;
